                if(dbname=="g_stest__o_dtest" || dbname=="g_stest2__o_dtest2"){
                  this.props.history.push('/userlist');
                }
    }
    render(){        
        return(
            <div className="container" class="body">
                <h3>SEARCH</h3>
                <form action="" method="post" onSubmit={this.onsub} class="form" >
                    <br/>
